pub enum PageState {
    Present {
            base: (Lsn, DiskPtr, u64),
            frags: Vec<(Lsn, DiskPtr, u64)>,
        },
    Free(Lsn, DiskPtr),
    Uninitialized,
}

pub enum Error {
    CollectionNotFound(IVec),
    Unsupported(String),
    ReportableBug(String),
    Io(io::Error),
    Corruption {
            at: Option<DiskPtr>,
            bt: (),
        },
}

pub enum Event {
    Insert {
            key: IVec,
            value: IVec,
        },
    Remove {
            key: IVec,
        },
}

pub enum ConflictableTransactionError<T = Error> {
    Abort(T),
    Conflict,
    Storage(Error),
}
